import React, { useState, useEffect } from 'react';

function VehicleList() {
    const [vehicles, setVehicles] = useState([]);

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async () => {
        try {
            const response = await fetch('http://localhost:3006/ads?page=1');
            if (!response.ok) {
                throw new Error('Network response was not ok');
            }
            const data = await response.json();
            setVehicles(data); // Actualiza el estado con los datos de los vehículos
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    return (
        <div>
            <h2>Lista de Vehículos</h2>
            <ul>
                {vehicles.map(vehicle => (
                    <li key={vehicle.id}>
                        <strong>Marca:</strong> {vehicle.brand}, <strong>Modelo:</strong> {vehicle.model}, <strong>Año:</strong> {vehicle.year}, <strong>Color:</strong> {vehicle.color}, <strong>Matrícula:</strong> {vehicle.plate}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default VehicleList;
